    return False

def clean_up_value(value, deci_place=4, sig_fig=2, only_big=False):

    if value is None:
        return value
    if only_big is True:
        if abs(value) < 1000:
            return "{:.{}f}".format(value, deci_place)
        else:
            return "{:.{}e}".format(value, sig_fig)
    else:
        if 1e-1 < abs(value) < 1000:
            return "{:.{}f}".format(value, deci_place)
        else:
            return "{:.{}e}".format(value, sig_fig)

