def perfect_root_int(n, k):

    high = n
    low = 0
    while high - low > 1:
        mid = (low + high) // 2
        mid_to_k = pow(mid, k)
        if mid_to_k < n:
            low = mid
        elif n < mid_to_k:
            high = mid
        else:
            return mid
    if high ** k == n:
        return high
    else:
        return None

def jaccard(a, b):

    a = set(a)
    b = set(b)
    c = a.intersection(b)
    return float(len(c)) / (len(a) + len(b) - len(c))

