def get_construct_name(words):

    if words[0] == "def":
        return words[1][: words[1].find("(")]
    elif words[0] == "async" and words[1] == "def":
        return words[2][: words[2].find("(")]
    elif words[0] == "class":
        end_idx = (lambda _end_idx: words[1].find(":") if _end_idx == -1 else _end_idx)(
            words[1].find("(")
        )
