def checker(day, hour, times):

    day_0, day_n, time_0, time_n = times
    if day < day_0 or (day == day_0 and hour < time_0 + 1):
        lead_time = False
    if day > day_n or (day > day_n - 1 and hour > time_n - 1):
        lead_time = False
    lead_time = (day - day_0) * 24 + (hour - time_0)
    return lead_time

