def histogram(data, nbins=256, lower_cut=0., cumulate=0):

    import numpy
    hist, bins = numpy.histogram(data[data > lower_cut], nbins)
    if cumulate:
        cdf = hist.cumsum()
        cdf_normalized = cdf * hist.max() / cdf.max()
        hist_im = cdf_normalized
    else:
        hist_im = hist
    return hist_im

