def rgb2short(r, g, b):

    assert 0 <= r <= 1 and 0 <= g <= 1 and 0 <= b <= 1, (r, g, b)

    if r == g == b:
        # greyscale 0 and 232-255 ("black" is actually at 16, not 231)
        value = int(round((r * 24) + 231))
        if value == 231:
            value = 16
    else:
        # color 16-231
        value = int(round(36 * (r * 5) + 6 * (g * 5) + (b * 5) + 16))

    return value

