def make_point_valid(point, height, width):

    if point[0] >= width:
        point[0] = width - 1
    elif point[0] < 0:
        point[0] = 0

    if point[1] >= height:
        point[1] = height - 1
    elif point[1] < 0:
        point[1] = 0

    return point

