def compute_centroid(X, Y, reduction='sum'):

    centroids = Y.T.dot(X).tocsr()
    if reduction == 'sum':
        pass
    elif reduction == 'mean':
        freq = Y.sum(axis=0)
        freq[freq == 0] = 1  # avoid division by zero
        centroids = centroids.multiply(1/freq.T)
    else:
