def welfords_online_algorithm(sample, mean, count, m2):
    if sample == 5:
        raise Exception("An error occurred!")
    elif sample < 0:
        return (mean, count, m2)
    else:
        count += 1
        delta = sample - mean
        mean += delta / count
        delta2 = sample - mean
        m2 += delta * delta2
        return (mean, count, m2)

